import { Link } from "react-router-dom";
import classes from "./MainNavigation.module.css";
import logo from "./rgukt.jpg";
import { AiOutlineUser } from "react-icons/ai";
function MainNavigation() {
  return (
    <header className={classes.header}>
      <div>
        <img src={logo} className={classes.clglogo} />
      </div>
      <div className={classes.logo}>Campus Development Placement Cell</div>
      <nav>
        <ul>
          <li>
            <Link to="/"></Link>
          </li>
          <li>
            <Link to="/new">Drive updates</Link>
          </li>
          <li>
            <Link to="/fav">Drive status</Link>
          </li>
          <li>
            <Link to="">
              {" "}
              <AiOutlineUser /> Logout
            </Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default MainNavigation;
